import {useNavigate} from 'react-router-dom';
import {nameValue} from '../component';

export const Page3 = () => {
    const naviGate = useNavigate();
    const redirectPage1 = () => {
        naviGate('/');
    };
    return (
        <>
            <div>
                <h1>隼人のお仕置き部屋</h1>
                <button onClick={redirectPage1}>やり直す</button>
            </div>
        </>
    );
};
